import React, { useState } from "react";
import { Document, Page, pdfjs } from "react-pdf";
import jsPDF from "jspdf"; // Import jspdf library
import Header from "../components/header";
import "./billing.css";
import { Button, Image } from "antd";
import html2canvas from "html2canvas";

pdfjs.GlobalWorkerOptions.workerSrc = `//cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjs.version}/pdf.worker.js`;

const Invoice = () => {
  const [numPages, setNumPages] = useState<number | null>(null); // Explicitly type numPages as number | null

  const onDocumentLoadSuccess = ({ numPages }: { numPages: number }) => {
    // Explicitly type numPages as number
    setNumPages(numPages);
  };

  const data = [
    {
      "company name": "L&T",
      "Product Name": "some",
      price: 34,
      quantity: 4,
      gst: 18,
      tax: 34,
    },
  ];

  const generatePDF = async () => {
    const content = document.querySelector(".pdf") as HTMLElement; // Type assertion
    if (content) {
      html2canvas(content).then((canvas) => {
        const imgData = canvas.toDataURL("");
        const pdf = new jsPDF();
        const imgWidth = 210;
        const pageHeight = 295;
        const imgHeight = (canvas.height * imgWidth) / canvas.width;
        let heightLeft = imgHeight;
        let position = 0;
  
        pdf.addImage(imgData, "PNG", 0, position, imgWidth, imgHeight);
        heightLeft -= pageHeight;
  
        while (heightLeft >= 0) {
          position = heightLeft - imgHeight;
          pdf.addPage();
          pdf.addImage(imgData, "PNG", 0, position, imgWidth, imgHeight);
          heightLeft -= pageHeight;
        }
        pdf.save("invoice.pdf");
      });
    }
  };

  return (
    <div className="dash-container">
      <Header />
      <div className="paper-billing">
        <div className="pdf">
          <div className="head-pdf">
            <div className="pdf-header">
              <div className="pdf-header-logo">
              <img
                width={60}
                src="data:image/png;base64,"
              />
              </div>
              <div className="head-content-pdf">
                <span style={{fontSize: "30px", fontWeight:"600"}}>Invoice</span>
              </div>
            </div>
          </div>
        </div>
        <Button onClick={generatePDF} className="pdf-download-button">
          Download PDF
        </Button>
      </div>
    </div>
  );
};

export default Invoice;
